// src/Signup.js
import React from 'react';

function Signup() {
  return (
    <div>
      <h2>Signup Page</h2>
      <form>
        <div>
          <label>Username: </label>
          <input type="text" name="username" />
        </div>
        <div>
          <label>Password: </label>
          <input type="password" name="password" />
        </div>
        <button type="submit">Signup</button>
      </form>
    </div>
  );
}

export default Signup;
